import React, { useState } from 'react';
import { supabase } from '../supabaseClient';
import './Login.css';

const Login = ({ setIsAuthenticated, setStudentData }) => {
  const [credentials, setCredentials] = useState({
    institutional_email: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // STRICT PTC institutional email validation
  const isValidPTCEmail = (email) => {
    const ptcPattern = /^[a-zA-Z0-9._%+-]+@paterostechnologicalcollege\.edu\.ph$/i;
    return ptcPattern.test(email);
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    console.log('?? LOGIN ATTEMPT STARTED');
    console.log('?? Email:', credentials.institutional_email);

    // STRICT VALIDATION - Only @paterostechnologicalcollege.edu.ph
    if (!isValidPTCEmail(credentials.institutional_email)) {
      const errorMsg = 'Access restricted to PTC institutional emails only (@paterostechnologicalcollege.edu.ph)';
      console.log('? Email validation failed');
      setError(errorMsg);
      setLoading(false);
      return;
    }

    try {
      console.log('?? Checking institutional_students table...');

      // SIMPLIFIED: Only check institutional_students table
      const { data: student, error: studentError } = await supabase
        .from('institutional_students')
        .select('*')
        .eq('institutional_email', credentials.institutional_email)
        .single();

      console.log('?? Student query result:', student);
      console.log('? Student query error:', studentError);

      if (studentError) {
        console.log('? Database error:', studentError);
        if (studentError.code === 'PGRST116') {
          setError('No student account found with this institutional email.');
        } else {
          setError('Database error: ' + studentError.message);
        }
        setLoading(false);
        return;
      }

      if (!student) {
        console.log('? No student found in database');
        setError('No student account found. Please contact MIS office.');
        setLoading(false);
        return;
      }

      console.log('? Student found:', student);

      // SIMPLIFIED PASSWORD CHECK - Remove student_credentials check for now
      const validPasswords = ['welcome123', 'password123', 'ptc2024', '123456'];

      if (validPasswords.includes(credentials.password)) {
        console.log('? Password valid - Logging in...');

        setIsAuthenticated(true);
        setStudentData(student);
        console.log('?? LOGIN SUCCESS - Redirecting to dashboard');
      } else {
        console.log('? Invalid password entered');
        setError(`Invalid password. Try: ${validPasswords.join(', ')}`);
      }

    } catch (err) {
      console.log('?? Unexpected error:', err);
      setError('Login failed: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  // Test database connection on component load
  React.useEffect(() => {
    const testConnection = async () => {
      console.log('?? Testing Supabase connection...');
      try {
        const { data, error } = await supabase
          .from('institutional_students')
          .select('count')
          .limit(1);

        if (error) {
          console.log('? Supabase connection failed:', error);
        } else {
          console.log('? Supabase connection successful');
        }
      } catch (err) {
        console.log('?? Connection test error:', err);
      }
    };

    testConnection();
  }, []);

  return (
    <div className="login-container">
      <div className="login-form">
        <div className="login-header">
          <img src="/logo-ptc.png" alt="PTC Logo" className="ptc-logo" />
          <h1>Pateros Technological College</h1>
          <p>Student Portal - Institutional Access Only</p>
          <div className="allowed-domains strict">
            <strong>DEBUG MODE ACTIVE</strong>
            <br />
            <small>Check browser console (F12) for details</small>
          </div>
        </div>

        <form onSubmit={handleLogin}>
          <div className="form-group">
            <label>PTC Institutional Email</label>
            <input
              type="email"
              placeholder="juan.delacruz@paterostechnologicalcollege.edu.ph"
              value={credentials.institutional_email}
              onChange={(e) => setCredentials({...credentials, institutional_email: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label>Password</label>
            <input
              type="password"
              placeholder="Try: welcome123"
              value={credentials.password}
              onChange={(e) => setCredentials({...credentials, password: e.target.value})}
              required
            />
          </div>

          {error && (
            <div className="error-message">
              <strong>Error:</strong> {error}
            </div>
          )}

          <button type="submit" disabled={loading} className="login-btn">
            {loading ? 'Logging in...' : 'Login to Student Portal'}
          </button>
        </form>

        <div className="test-credentials">
          <h4>Test Credentials (Use these):</h4>
          <p><strong>Email:</strong> juan.delacruz@paterostechnologicalcollege.edu.ph</p>
          <p><strong>Password:</strong> welcome123</p>
          <p><strong>Alternative Passwords:</strong> password123, ptc2024, 123456</p>
        </div>

        <div className="login-footer">
          <p><strong>Note:</strong> Open browser console (F12) to see debug information</p>
        </div>
      </div>
    </div>
  );
};

export default Login;
